query jobHistoryEater($request: JobHistoryRequest__Input!) {
  jobHistory(request: $request) {
    ... on JobHistoryResponse {
      hasMore
      nextCursor
      jobs {
        jobID
        imageUrl
        description
        date
        formattedDate
        rating
        fareLocalString
        status
        userTypeData {
          __typename
          ... on EaterUserTypeData {
            orderItemsArr
            orderItemsCount
            __typename
          }
        }
        __typename
      }
      __typename
    }
    ... on JobHistoryBadRequestError {
      message
      __typename
    }
    ... on JobHistoryNotFoundError {
      message
      __typename
    }
    __typename
  }
}

query GetCheckoutDetails($orderID: String!) {
    checkoutSession(token: $orderID) {
        cart {
            billingType
            productCode
            intent
            paymentId
            billingToken
            amounts {
                total {
                    currencyValue
                    currencyCode
                    currencyFormatSymbolISOCurrency
                }
            }
            supplementary {
                initiationIntent
            }
            category
        }
        flags {
            isChangeShippingAddressAllowed
        }
        payees {
            merchantId
            email {
                stringValue
            }
        }
    }
}
